import React from "react";
import { useState, useEffect } from "react";

// const [ngos, setngos] = useState([])

export default function Getngo(){
useEffect(() => {
    fetch("http://127.0.0.1:8000/ngo-list/", {
      'method' : 'GET'
    })
        .then(res => res.json())
        .then(data => console.log(data))
  }, [])
}
